import React from 'react';
import FbImageLibrary from 'react-fb-image-grid'

// docs
// https://react-slick.neostack.com/docs/example/adaptive-height

const styles = {
  card: {
    marginLeft: 25,
    marginRight: 25
  },
  media: {
    height: 400,
  },
  grid : {
    maxWidth: 700,
    marginLeft: 'auto',
    marginRight: 'auto',
  },

  thumbnail: {
    cursor:'pointer',
    maxWidth: '100',
    height: 'auto',
  }
}

class PortfolioCarousel extends React.Component {
  render(){
    const {
      projectsFound,
      openProjectDialog
    } = this.props
    return(
      <div style = {styles.grid}>
      <h1>Projects</h1>
      <FbImageLibrary 
        images={ projectsFound.map( project => project.thumbnail )} 
        onClickEach={({src, index}) => openProjectDialog(index) }
      />
      </div>
    )
  }
}


export default PortfolioCarousel;
